import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import ProductManagement from './Pages/ProductManagement'; // Import the ProductManagement component

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/Pages/ProductManagement" component={ProductManagement} />
      </Switch>
    </Router>
  );
}

export default App;
